import React,{useEffect, useState} from 'react';
import './App.css';

const App = () => {

  const API_ID = "d7a5a694";
  const API_KEY = "286e3bf218dfffc0781b1a3e14833cb5";
  const exampleReq = `https://api.edamam.com/search?q=chicken&app_id=${API_ID}&app_key=${API_KEY}`;

  const [counter, setCounter] = useState(0);

  useEffect(() => {
    console.log('Effect has been run');

  });

  return(
    <div className="App">
      <form className="search-form">
        <input className="search-bar" type="text" />
        <button onClick={() => setCounter(counter + 1)} className="search-button" type="submit">
          {counter}
        </button>
      </form>
    </div>
  );
}

export default App;
